import React from 'react';

function ItemDetail(props) {
    return (
        <div>
            <div>
                <p>{props.product.title}</p>
            </div>
            <div>
                {props.product.pictures.map((picture) => (
                    <p>{picture.url}</p>
                )
                )}
            </div>
        </div>
    );
}

export default ItemDetail;
